description:
The lives of two childhood best friends, Bill and Epstein, in the late 1890s as they flock to the gold rush capital in the untamed Yukon Territory. This man-versus-nature tale places our heroes in a landfull of undiscovered wealth, but ravaged by harsh conditions, unpredictable weather and desperate, dangerous characters including greedy businessmen,seductive courtesans and native tribes witnessing the destruction of their people and land by opportunistic entrepreneurs.
